Deb pakke','Laves som i de andre projekter',5,10,50,'2013-07-09 08:27:43','',1,5,4,7,5),(56,'Antal skader','Lige som i AEH hvor der regnes på beløb, skal der laves en tilsvarende som regner på antal skader i hvert ulykkesår og udviklingsår.\nMenuen skal udvide med en hovedkategori \'Analyse antal\' og som i undermenu har det samme som i AEH undermenu, men på 3 niveau har den: Rå data, Kvartalsregulering, Chainladder, Halefit og Bornhuetter-Ferguson. Tallene skal ikke indekseres.\nRet modelmæssigt indføres en ny type til data s1, s2, s3, sa1 og sa2 som opføres sig på samme måde som t1 til t3 og a1 og a2. A1 og a2 omdøbes til ta1 og ta2.\n',2,4,50,'2013-07-09 09:03:36','',1,5,6,7,6),(57,'Gennemsnitsskade','En gennemsnitsskade (se Deloitte materialle) udregnes i ultimate/reserven for hvert skadeår.\nBHF (Bornhuetter-ferguson), hvor dette regnes, skal parametiseres så den ved om den skal regnes ultimate på beløb eller på antallet af skader.\nResultat vises i ny menu som kommer efter rapporter',1,2,50,'2013-07-09 09:08:25','',1,5,6,7,6),(58,'PensionAge som library','PensionAge laves som et library med composer og integreres med hm og fs10 projektet. Er integreret i hm men i fs10 implementeres den i InsuranceMath',3,6,50,'2013-07-09 09:22:52','',1,5,4,7,5),(59,'Migrerer Ruckusing til version git','Dvs at den integreres med composer',5,10,50,'2013-07-09 09:28:42','',1,5,4,7,5),(60,'Alder på skadetidspunktet','Se materiale fra Deloitte om vores nuværende udregning og den fremtidige udregning. Tilsyneladende er det kun en ændring i Cashflow.calcLiability som skal ændres.',2,4,50,'2013-07-09 10:23:17','',1,5,6,5,6),(61,'Danske tegn i showfile fejler','/show_file.php?print=yes&file=20130145/AcceptTilbud.tandl\\xe6ge.2013jul%209-1527.pdf&div_id=doku66342 HTTP/1.1\" 404 - \"http://test-fs10/tcpdf-templates/wizard-result.php\" \"Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.2; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)\"',1,2,50,'2013-07-09 13:34:46','',2,5,4,7,9),(64,'GUI til håndtering af faktura',NULL,3,6,50,'2013-07-10 08:31:05','',1,5,8,7,6),(65,'Følsomhedsanalyser','Der oprettes et hovedmenupunkt \"Analyse følsomhed\", som kan rummer flere analyser (Side 15 i Deloittes mat.). Hver analyse navngivnes ifht hvad det er man stresser fx: inflation. Alle analyserne er knyttet til et workspace og de enkelte parameter gemmes.\nHensættelses beløbet er sum af aeh, ly og sbo ultimo.\nVises efter AEH antal',1,2,50,'2013-07-11 11:13:16','',1,5,6,5,6),(66,'Følsomhed, aeh+ly+sbo, inflation','Parameter er her en konstant som tillægges inflationsudregning. Se Deloitte materialle.',2,4,50,'2013-07-11 11:19:44','',1,5,6,5,6),(67,'RAS fjernes fra FS10','Migrate fjerne tabeller, Testcases fjernes og UI fjernes',1,2,50,'2013-07-11 11:20:48','',1,5,4,7,5),(69,'Følsomhed, aeh, BHF','Dette er en konstant som tilægges alle valgte ULR værdier. en valgt ulr værdi kommer fra valgt url kolonnen og som har en anden værdi end samme i ulr kolonnen. Se Deloitte materiale',2,4,50,'2013-07-11 11:56:19','',1,5,6,5,6),(70,'Følsomhed, aeh, halefit','Se Deloitte mat. side 14, hvor der tilrettes en værdi til alle værdier i CLDF\'en.',2,4,50,'2013-07-11 11:57:56','',1,4,6,5,6),(71,'Sammenligning af workspaces','Generelt laves en knap \"Sammenligning\" i på workspace niveau, hvor man kan sammenligne ultimate på tværs af workspaces.\nJM skal finde på en bedre overskrift end sammenlign, det er et solvens II krav at vi kan sammenligne forventet med faktisk.\nSamligne opbygges på samme måde som et workspace, hvor første menu er de forskellige sammenligninger og anden menu (hvis der behov for dette) er trekanterne.',2,4,50,'2013-07-11 12:02:09','',1,5,6,7,6),(72,'Sammenligne ultimate','Her kan man sammenligne udvikling ultimate for de enkelte skadeår. Se Deloittes materiale. En workspacevælger a la \"tidligere valgte\" som fungere på den måde, at nå et valg er taget, forsvinder den fra de mulige man kan vælge imellem, og bliver