s af ”RAS edit” rollen. Se sideskitse i fs10/doc.',1,2,50,'2013-09-11 12:34:02','',1,4,2,7,5),(146,'Dokumentation','Man skal kunne lave dokumentation i stil med hm og ras',2,4,50,'2013-09-11 12:36:15','',1,5,4,7,5),(147,'Afgørelse typer','\'Set\' ændres til igangværende. Der byttes rundt på Godkendt og anket. Tilbageholdt fjernes',1,2,50,'2013-09-11 12:37:25','',1,5,4,7,5),(148,'Afgørelser typeskift','Til højre for status vises datoen for dette status skift',1,2,50,'2013-09-11 12:38:25','',1,4,4,7,5),(149,'Ny afgørelsestype','Ny type \'rettelse\' indføres aht til afstemning med finans. Den skal have felterne status, dato og beløb',1,2,50,'2013-09-11 12:39:33','',1,4,4,7,5),(150,'Efterladte fødselsdato','Enten skal cpr eller dato og køn udfyldes.',2,4,50,'2013-09-11 12:47:42','',1,4,4,7,5),(151,'Efterladte på afgørelser','de kommer ikke frem når man har oprettet en efterladt',1,2,50,'2013-09-11 12:48:28','',2,5,4,7,5),(152,'Sortering af afgørelser','Sorteres på type, dato. Kontoret høres.',0,0,50,'2013-09-11 12:49:07','afvist',1,5,4,NULL,5),(153,'Gældende fra på RBNS',' Ved enhver vurdering af en hensættelse for EET kan der angives en gældende fra dato. Denne skal ligge efter ulykkesdatoen.\nFeltet skal bruges til at udregne en evt efterbetaling.',NULL,NULL,50,'2013-09-11 12:52:06','Kontor',1,1,4,NULL,5),(155,'Ny afgørelsestype','\'Kulance-erstatning\' er en erstatningstype som gives uden forpligtelse fx kapringer. Den skal have status-, dato- og et beløbsfelt.',1,2,50,'2013-09-11 12:55:48','',1,4,4,7,5),(156,'Efterbetaling RBNS','Efterbetaling udregnes som forskellen mellem gældende fra og registreringsdatoen (tidsintervallet). Efterbetaling er ydelsen pr måned * tidsintervallet. Hvis der ingen dato er lægges en given system parameter tidsinterval til. Afventer diskurs om gældende fra.',NULL,NULL,50,'2013-09-11 13:00:25','kontor',1,1,4,NULL,5),(157,'En RBNS pr dag','Det skal kun være muligt at oprettes èn hensættelse pr dato. Det skal gives en advarsel til brugeren herom. Pt er det muligt at lave 7 ens hensættelse på samme dag.',1,2,50,'2013-09-11 13:02:10','',1,4,4,7,5),(158,'RBNS: Overgangsbeløb enke','Når enker for tilkendt en erstatning er det for en periode og et kontant beløb (overgangsbeløb ved dødsfald). Dette overgangsbeløb er reguleret af  ASK. Ulykkesdato er bestemende for beløbets størrelse. Fx Hvis dødsfaldet sker i januar 2012 så er det 2012 beløbet som er gældende.\nNår man opretter en RBNS på en FTE skal man tillige kunne angive om der skal hensættes til et overgangsbeløb. Hvis det er tilfældet findes beløbet som beskrevet ovenfor.',2,4,50,'2013-09-11 13:03:19','',1,5,4,5,5),(159,'Liste: rbns pr. dato reberegnet','Rbns beregning ifht pr datoen. Den laves som ny rapport \'Rbns reberegnet pr dato\' med samme indhold som \'Rbns pr dato\'. Her reberegnes alle Rbns\'er til denne dato + 1 dag. Rbns\'erne må ikke gemme sit indhold.',1,2,50,'2013-09-11 13:04:41','',1,4,4,7,5),(160,'Hjælpeadresser','Under menuen stamdata oprettes en fane hvori man kan redigere hjælpeadresser. Disse adresser migreres fra hjadr tabellen.Den skal indeholde navn, 4 adresselinie, email, rederi-id. Navn vises i gui og hentes fra rederi tabellen.\nRederi-id verfificeres imod rederi tabellen.\nCheck lige #92 som nu skal hente reders email adresse herfra istedet.',3,6,50,'2013-09-11 13:05:27','',1,4,4,7,5),(161,'Omdøbe brev','Det skal muligt at omdøbe et tomtbrev fra oversigten.',2,4,50,'2013-09-11 13:08:52','',1,4,4,7,5),(162,'Korrespondance sortering','Denne sorteres med nyeste brev først',1,2,50,'2013-09-11 13:09:23','',1,5,4,7,5),(163,'Fejl vil ikke sende brev','Dette skyldes mangle mangler klasse på pathen',1,2,50,'2013-09-11 13:15:27','',2,5,4,5,8),(164,'Fejl om vedhæftninger','Tand brevene havde forkert vedhæftninger',1,2,50,'2013-09-11 13:16:59','',2,5,4,5,8),(165,'Tidligere breve kom frem på slutside',NULL,1,2,50,'2013-09-11 13:18:04','',2,5,4,5,8),(166,'Email brev','Det ville være rart at kunne sende breve fra oversigten',2,4,50,'2013-