ræcist med et mellemrum mellem til EAN.\n\nPå linjen under kan så skrives Ordrenr.:  .... og Kontost.: .... og der skulle således være plads til de ca. 80 karakterer.',1,2,50,'2013-10-03 12:23:37','v2',1,1,8,NULL,5),(193,'Undersøg teksten stabilitet','Det skal undesøges hvordan teksten flytter sig.',2,4,50,'2013-10-03 12:26:44','',1,5,8,5,5),(194,'Fejlfindning af \"Der er opstået en eller flere fejl\"',NULL,1,2,50,'2013-10-04 07:26:49','',2,5,8,7,7),(195,'Småfejl fra JM','**** 24-9-2013 *****\n1) Dokumentation virker ikke * dog kun mellem Kunder og Kunden\n5) Print virker ikke\nNy-1 Kunder/kunden her rettes Kundenr til Rederinr.\nNy-2 Kunden/Fakturaer Dato rettes til Bilagsdato.\nNy-3 Import status skal sorteres yngste først\nNy-4 Spoom kolonnen Faktura rettes til  Bilagsnr.\nNy-5 Spoom sorteres yngste først\nNy-6 Spoom gerne en mouse over eller link til egentlig fejl beskrivelse\nNy-7 I testmiljø skal kundens EAN nulles og vort cvr indsættes i kundens cvr, Fakturaens notefelt bør tilføjes følgende tekst (foran evt eksisterende tekst) \"Test *** ej sendt til EAN: #############, men til CVR: 67760719\"\n\nDer udestår test på \n\n  * summer i datamodel samt kontrol heraf i OIO\n  * at overførelse fra AS400 og konvertering til PAS forløber ok\n  * at afsendelse via SPOOM forløber OK\n\n',1,2,50,'2013-10-04 07:34:50','v2',1,1,8,7,6),(196,'Flyt nota over på faktura niveau',NULL,1,2,50,'2013-10-04 07:47:52','',1,5,8,7,7),(197,'Sat PAS i produktion',NULL,1,2,50,'2013-10-04 11:26:04','',3,5,8,NULL,7),(199,'Logind eller ej?',NULL,1,2,50,'2013-10-04 11:55:22','',1,5,8,7,7),(200,'Address på OIO','Alle OIO når man siger vis, har samme adresse.',NULL,NULL,50,'2013-10-07 12:05:32','',2,5,8,7,5),(201,'Enhedpris/antal enheder OIO','Endhedpris vises med for mange decimaler.',NULL,NULL,50,'2013-10-07 12:13:50','',2,5,8,7,5),(202,'Oioubl profile fejl','Forkert profile i oioubl\'en',1,2,50,'2013-10-08 08:12:05','',1,5,8,7,6),(203,'Tilrette parser',NULL,2,4,50,'2013-10-08 10:17:07','',1